/**
 * Term Enrichment Controller
 */
class TermEnrichmentController extends Controller
{
	
	/**
	 * GO Enrichment
	 * @Route("/term_enrichment/")
	 * @Route("/term_enrichment/{search_term}", name="term_enrichment", options={"expose": true})
	 * @Method({"GET", "POST"})
	 */
	public function termEnrichmentAction($search_term, Request $request)
	{
		
		$term_enrichment_array = self::getTermEnrichment($search_term);
		
		$response = new JsonResponse();
		$response->setData($term_enrichment_array);
		
		return $response;
		
	}
	
	public function getTermEnrichment($query_string){
		
		$query_string_array = preg_split( '/,/', $query_string);
		
		$query_protein_array = self::getProteinQueryArray($query_string_array);
		
		$functions = $this->get('app.functions');
		$connection =  $functions->mysql_connect();

		$or_array = array();
		
		foreach($query_protein_array as $query_protein){
			$protein_id = $query_protein->getId();
			$or_array[]= "`protein`.id = $protein_id";
			
		}
		
		$or = join(" OR ", $or_array);

		$query_subcellular_location = "SELECT * FROM `subcellular_location_expression` INNER JOIN `protein`
		ON `subcellular_location_expression`.protein_id	= `protein`.id WHERE" . $or;

		$result = $connection->query($query_subcellular_location);
		
		$subcellular_location_array = array('aggresome', 'cell_junctions', 'centrosome', 'cytokinetic_bridge', 'cytoplasmic_bodies', 'cytosol', 'endoplasmic_reticulum', 'endosomes', 'focal_adhesion_sites', 'golgi_apparatus', 'intermediate_filaments', 'lipid_droplets', 'lysosomes', 'microtubule_ends', 'microtubule_organizing_center', 'microtubules', 'midbody', 'midbody_ring', 'mitochondria', 'mitotic_spindle', 'nuclear_bodies', 'nuclear_membrane', 'nuclear_speckles', 'nucleoli', 'nucleoli_fibrillar_center', 'nucleoplasm', 'nucleus', 'peroxisomes', 'plasma_membrane', 'rods_and_rings', 'vesicles');
		
		$location_array = array();
		
		if($result){
			while($row = $result->fetch_assoc()) {
				foreach($subcellular_location_array as $subcellular_location){
					
					$location = $row["$subcellular_location"];
					$uniprot_id = $row["uniprot_id"];
					$gene_name = $row["gene_name"];
					
					
					if($location != null){
						
						$subcellular_location_name = str_replace("_"," ", $subcellular_location);
						$location_array[$subcellular_location][] = array($uniprot_id, $gene_name, $subcellular_location_name, $location);
					}	
				}
			}
		}
		
		
		$tissue_expression_array = array();
		
		$query_tissue_expression = "SELECT * FROM `tissue_expression` INNER JOIN `protein`
		ON `tissue_expression`.protein_id	= `protein`.id WHERE" . $or;
		
		$result = $connection->query($query_tissue_expression);
		
		$tissue_name_array = array('adipose_subcutaneous', 'adipose_visceral_omentum', 'adrenal_gland', 'artery_aorta', 'artery_coronary', 'artery_tibial', 'brain_0', 'brain_1', 'brain_2', 'breast_mammary_tissue', 'colon_sigmoid', 'colon_transverse', 'esophagus_gastroesophageal_junction', 'esophagus_mucosa', 'esophagus_muscularis', 'heart_atrial_appendage', 'heart_left_ventricle', 'kidney_cortex', 'liver', 'lung', 'minor_salivary_gland', 'muscle_skeletal', 'nerve_tibial', 'ovary', 'pancreas', 'pituitary', 'prostate', 'skin', 'small_intestine_terminal_ileum', 'spleen', 'stomach', 'testis', 'thyroid', 'uterus', 'vagina', 'whole_blood');
		$array = array();
		
		if($result){
			while($row = $result->fetch_assoc()) {
				foreach($tissue_name_array as $tissue_name){
					
					$tissue_expression = $row["$tissue_name"];
					$uniprot_id = $row["uniprot_id"];
					$gene_name = $row["gene_name"];
					if($tissue_expression >= '5.0'){
						$new_tissue_name = str_replace("_"," ", $tissue_name);
						$array[$tissue_name][] = array($uniprot_id, $gene_name, $new_tissue_name, $tissue_expression);
					}
				}
			}
		}
		
		$tissue_expression_array = $array;
		$query_string = str_replace(",","%20",$query_string);
