	public function getProteinQueryArray($search_query_array){
		
		$query_protein_array = array();
		
		foreach($search_query_array as $query_protein_identifier){
			
			$protein_repository = $this->getDoctrine()
			->getRepository('AppBundle:Protein');
			
			$functions = $this->get('app.functions');
			$connection =  $functions->mysql_connect();
			
			$query = "SELECT * FROM `identifier` WHERE `identifier` = '$query_protein_identifier'";
			$result = $connection->query($query);
			
			if($result){
				$row = $result->fetch_assoc();
				$identifier_id = $row['id'];
				$query2 = "SELECT * FROM `protein_identifier` WHERE `identifier_id` = '$identifier_id'";
				$result2 = $connection->query($query2);
				if($result2){
					while($row2 = $result2->fetch_assoc()){
						
						$protein_id = $row2['protein_id'];
						$protein = $protein_repository->findOneById($protein_id);
						$query_protein_array[] = $protein;
					}
				}
			}
		}
		
		return $query_protein_array;
	}

